{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/mihailisman/telecom-customer-churn?scriptVersionId=127559139\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"24e4675e","metadata":{"papermill":{"duration":0.034195,"end_time":"2023-04-28T10:50:31.441039","exception":false,"start_time":"2023-04-28T10:50:31.406844","status":"completed"},"tags":[]},"source":["# Telecom Customer Churn \n","## Google Data Analytics Capstone Project\n","#### Mihai Lisman \n","#### April 2023\n","<a id=\"section-zero\"></a>\n"]},{"cell_type":"markdown","id":"e6d8b0bf","metadata":{"papermill":{"duration":0.030366,"end_time":"2023-04-28T10:50:31.503992","exception":false,"start_time":"2023-04-28T10:50:31.473626","status":"completed"},"tags":[]},"source":["\n","*  Churn data for a fictional telecommunications company that provides phone and internet services to 7,043 customers in California, and includes details about customers such as demographics, location, additional services, revenue, and current status.\n"," \n","* This analysis is a capstone project for the Google Data Analytics Certificate. I will be using the telecom_churn dataset from the Maven Analytics [Data Playground](https://www.mavenanalytics.io/data-playground) for the case study. \n","* The six steps of the data analysis process used are: **Ask**, **Prepare**, **Process**, **Analyze**, **Share**, and **Act**.\n"]},{"cell_type":"markdown","id":"0cc40ad1","metadata":{"papermill":{"duration":0.032427,"end_time":"2023-04-28T10:50:31.566867","exception":false,"start_time":"2023-04-28T10:50:31.53444","status":"completed"},"tags":[]},"source":["# About Data\n","<a id=\"section-one\"></a>"]},{"cell_type":"markdown","id":"3247580b","metadata":{"papermill":{"duration":0.031912,"end_time":"2023-04-28T10:50:31.630246","exception":false,"start_time":"2023-04-28T10:50:31.598334","status":"completed"},"tags":[]},"source":["\n","* The Customer Churn dataset contains 7,043 customer data from a Telecommunications company in California in Q2 2022.\n","\n","* Each record represents one customer, and contains details about their demographics, location, tenure, subscription services, status for the quarter (joined, stayed, or churned), and more!\n","\n","* The Zip Code Population table contains complimentary information on the estimated populations for the California zip codes in the Customer Churn table\n","\n"]},{"cell_type":"markdown","id":"1789448c","metadata":{"papermill":{"duration":0.030447,"end_time":"2023-04-28T10:50:31.691309","exception":false,"start_time":"2023-04-28T10:50:31.660862","status":"completed"},"tags":[]},"source":["# 1. Ask\n","<a id=\"section-two\"></a>"]},{"cell_type":"markdown","id":"bc55f3f4","metadata":{"papermill":{"duration":0.030208,"end_time":"2023-04-28T10:50:31.752678","exception":false,"start_time":"2023-04-28T10:50:31.72247","status":"completed"},"tags":[]},"source":["#### A brief description of the business task "]},{"cell_type":"markdown","id":"3864957e","metadata":{"papermill":{"duration":0.030307,"end_time":"2023-04-28T10:50:31.813229","exception":false,"start_time":"2023-04-28T10:50:31.782922","status":"completed"},"tags":[]},"source":["Understanding the business context is critical. During the \"Ask\" phase, as many questions as possible should be asked. These questions should be focused on the topic being explored, the problem to be solved, the metrics to be used, stakeholder identification, etc. Ultimately, the goal is to understand how the insights can help the client make decisions."]},{"cell_type":"markdown","id":"a3a48501","metadata":{"papermill":{"duration":0.030051,"end_time":"2023-04-28T10:50:31.913273","exception":false,"start_time":"2023-04-28T10:50:31.883222","status":"completed"},"tags":[]},"source":["The business task is to help the company improve retention by identifying high-value customers and churn risks. There are various key factors involved in this analysis, such as demographics, location, service type, contract length, etc. The scope is to identify insights about customer behaviors, patterns & data correlations, gaps, and ways to decrease the churn rate. This will benefit both the company and the customers by improving revenue, the quality of service, and customer satisfaction in a very competitive market."]},{"cell_type":"markdown","id":"2644a4f8","metadata":{"papermill":{"duration":0.030756,"end_time":"2023-04-28T10:50:31.974745","exception":false,"start_time":"2023-04-28T10:50:31.943989","status":"completed"},"tags":[]},"source":["# 2.Prepare \n","<a id=\"section-three\"></a>"]},{"cell_type":"markdown","id":"fe57b7fb","metadata":{"papermill":{"duration":0.030479,"end_time":"2023-04-28T10:50:32.035703","exception":false,"start_time":"2023-04-28T10:50:32.005224","status":"completed"},"tags":[]},"source":["#####  The telecom_churn dataset, sourced from Maven Analytics (http://https://www.mavenanalytics.io/), has been uploaded to the '/kaggle/working' directory along with two additional CSV files: \"telecom_data_dictionary\" and \"telecom_zipcode_population\". The next step involves evaluating the data's credibility, assessing for any potential biases, and determining the overall reliability of the dataset."]},{"cell_type":"markdown","id":"88123210","metadata":{"papermill":{"duration":0.030573,"end_time":"2023-04-28T10:50:32.09732","exception":false,"start_time":"2023-04-28T10:50:32.066747","status":"completed"},"tags":[]},"source":["####  In this step the data is gathered and stored appropriately."]},{"cell_type":"markdown","id":"c9f68c72","metadata":{"papermill":{"duration":0.030289,"end_time":"2023-04-28T10:50:32.158155","exception":false,"start_time":"2023-04-28T10:50:32.127866","status":"completed"},"tags":[]},"source":["##### I will first familiarize myself with the dataset, check for irregularities, structural errors, missing v